import React, {useState} from "react";
import './App.css';
import Car from "./Car/Car";

function App() {

    const divStyle = {
        textAlign: 'center'
    }

    const [stated, setStated] = useState({
        car: [
            {name: 'Ford', year: 2018},
            {name: 'Audi', year: 2016},
            {name: 'Mazda', year: 2010}
        ],
        pageTitle: 'React components'
    })

    const changeTitleHandler = () => {
        setStated({pageTitle: stated.pageTitle + ' changed'})
    }

    return (
        <div className="App" style={divStyle}>
            <h1>{stated.pageTitle}</h1>
            <button onClick={changeTitleHandler}>Change title</button>
            <Car name={state.car[0].name} year={state.car[0].year}/>
            <Car name={state.car[1].name} year={state.car[1].year}/>
            <Car name={state.car[2].name} year={state.car[2].year}/>
        </div>
    );
}

export default App;
